import { Link } from 'react-router-dom';

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1> Navbar Component!</h1>
            <div className="links">
                <a href="/">Home for the text</a>
                <a href="/create" style={{
                    color: "white",
                    backgroundColor: "#f1356d" ,
                    borderRadius: "8px"
                }}> New content</a>
            </div>
        </nav>
    );
}

export default Navbar;
